import { Link, NavLink } from "react-router-dom";

const Navigation = () => {
    return (
        <ul className="main-navigation">
            <li><NavLink to="/" className={({isActive}) => isActive ? 'active': ''}>Home</NavLink></li>
            <li><NavLink to="/product">Products</NavLink></li>
        </ul>
    )
}

export default Navigation;
